import React from "react";
import './Footer.css';

const Footer = () => {
    return (
        <div className="footer">Photo by <a href="https://unsplash.com/@lowestakesphotos?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Lowes Takes Photos</a> on <a href="https://unsplash.com/photos/EEyzA25P8pM?utm_source=unsplash&utm_medium=referral&utm_content=creditCopyText">Unsplash</a>
        </div>
    )
}

export default Footer;
